llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "Transfer to the zero address");
    require(amount > 0, "Transfer amount must be greater than zero");

    address sender = msg.sender;

    // Check transfer delay enabled
    if (transferDelayEnabled) {
        require(block.number > lastTransferBlock[sender], "Transfer delay enabled. Only one purchase per block allowed.");
        lastTransferBlock[sender] = block.number;
    }

    // Check sender and recipient are not bots
    require(!isBot[sender], "Sender is flagged as a bot");
    require(!isBot[recipient], "Recipient is flagged as a bot");

    // Check transfer limits
    require(amount <= _maxTxAmount, "Exceeds the max transaction amount");
    require(balanceOf(recipient) + amount <= _maxWalletSize, "Exceeds the max wallet size");

    // Calculate tax amount
    uint256 taxAmount = (amount * taxRate) / 100;
    uint256 transferAmount = amount - taxAmount;

    // Update balances
    balances[sender] -= amount;
    balances[recipient] += transferAmount;
    balances[address(this)] += taxAmount;

    // Emit transfer events
    emit Transfer(sender, recipient, transferAmount);
    emit Transfer(sender, address(this), taxAmount);
}

